
# Create a directory to store temporary files
mkdir new_temp_commits
cd new_temp_commits

# Loop to create 70+ commits
for ((i=1; i<=70; i++))
do
    # Create a new file with a unique name
    touch file$i.txt
    
    # Add some content to the file
    echo "Commit number $i" >> file_new$i.txt
    
    # Add the file to the staging area
    git add file$i.txt
    
    # Commit the changes
    git commit -m "Commit $i, â€¦â€¦
"

done

# Navigate back to the repository root directory
cd ..

# Remove the temporary directory
rm -rf new_temp_commits
